 950.13 0 950.2" fill="transparent" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" stroke="#181918"/><polygon points="0 857.19 0 861.3 0.22 857.21 0 857.19" fill="transparent" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" stroke="#243134"/>

	<footer>
		<div class="container" style="color: #ffde00">
			<div style="padding-top: 18px" class="pull-left"> <img src="LTCSLogo.svg" style="height: 50px" /> </div>
		</div>
	</footer>
	<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.0.0/jquery.min.js" integrity="sha384-THPy051/pYDQGanwU6poAc/hOdQxjnOEXzbT+OuUAFqNqFjL+4IGLBgCJC3ZOShY" crossorigin="anonymous"></script>
	<script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/js/bootstrap.min.js" integrity="sha384-Tc5IQib027qvyjSMfHjOMaLkfuWVxZxUPnCJA7l2mCWNIpG9mGCD8wGNIcPD7Txa" crossorigin="anonymous"></script>
	<script src="https://cdn.jsdelivr.net/vivus/latest/vivus.min.js"></script>


	<script>
		$(window).on("load", function() {
			$("#main").show();
			//console.log("LOADED.");
			drawNext();
		});


		function drawingDone() {
			var delayCounter = 5;
			//console.log("SUNSET DONE");
			$.each($("#drawing_sunset").children(), function(i, v) {

				if ($(v).attr("stroke")) {
					$(v).css({ fill: $(v).attr("stroke"), transition: "fill 1s linear " + delayCounter + "ms" });
					delayCounter += 5;
				}
			});

			setTimeout(resetScreen, (delayCounter + 4000));
		}


		function drawingDoneTulip() {
			var delayCounter = 5;
			//console.log("TULIP DONE");
			$.each($("#drawing_tulip").children(), function(i, v) {

				if ($(v).attr("stroke")) {
					$(v).css({ fill: $(v).attr("stroke"), transition: "fill 1s linear " + delayCounter + "ms" });
					delayCounter += 5;
				}
			});

			setTimeout(resetScreen, (delayCounter + 4000));
		}


		function drawingDonePeach() {
			var delayCounter = 5;
			//console.log("PEACH DONE");
			$.each($("#drawing_peach").children(), function(i, v) {

				if ($(v).attr("stroke")) {
					$(v).css({ fill: $(v).attr("stroke"), transition: "fill 1s linear " + delayCounter + "ms" });
					delayCounter += 5;
				}
			});

			setTimeout(resetScreen, (delayCounter + 4000));
		}

		function drawingDonePineapples() {
			var delayCounter = 5;
			//console.log("PINEAPPLES DONE");
			$.each($("#drawing_pineapples").children(), function(i, v) {

				if ($(v).attr("stroke")) {
					$(v).css({ fill: $(v).attr("stroke"), transition: "fill 1s linear " + delayCounter + "ms" });
					delayCounter += 5;
				}
			});

			setTimeout(resetScreen, (delayCounter + 4000));
		}

		function drawingDoneGoat() {
			var delayCounter = 5;
			//console.log("GOAT DONE");
			$.each($("#drawing_goat").children(), function(i, v) {

				if ($(v).attr("stroke")) {
					$(v).css({ fill: $(v).attr("stroke"), transition: "fill 1s linear " + delayCounter + "ms" });
					delayCounter += 5;
				}
			});

			setTimeout(resetScreen, (delayCounter + 4000));
		}

		function drawTulip() {
			$("#showcase_name").fadeOut("normal", function() {
				$("#showcase_name").text("Tulip - Alexandra D.").fadeIn();
			});
			$("body").css("background-color", "#c994c7");
			$("#drawing_tulip").show();
			v_tulip.play();
		}

		function drawPeach() {
			$("#showcase_name").fadeOut("normal", function() {
				$("#showcase_name").text("Peach - Sarah W.").fadeIn();
			});
			$("body").css("background-color", "#e4ffe0");
			$("#drawing_peach").show();
			v_peach.play();
		}

		function drawPineapples() {
			$("#showcase_name").fadeOut("normal", function() {
				$("#showcase_name").text("Pineapples - Dara F.").fadeIn();
			});
			$("body").css("background-color", "#f2fffc");
			$("#drawing_pineapples").show();
			v_pineapples.play();
		}

		function drawGoat() {
			$("#showcase_name").fadeOut("normal", function() {
				$("#showcase_name").text("Goat - Nawaal F.").fadeIn();
			});
			$("body").css("background-color", "#1c1b12");
			$("#drawing_goat").show();
			v_goat.play();
		}

		function drawSunset() {
			$("#showcase_name").fadeOut("normal", function() {
				$("#showcase_name").text("Ocean Sunset - Angel C.").fadeIn();
			});
			$("body").css("background-color", "#fef8b8");
			$("#drawing_sunset").show();
			v_sunset.play();
		}

		var v_pineapples = new Vivus('drawing_pineapples', {
			type: 'delayed',
			duration: 300,
			animTimingFunction: Vivus.EASE,
			start: "manual"
		}, drawingDonePineapples);

		var v_peach = new Vivus('drawing_peach', {
			type: 'delayed',
			duration: 200,
			animTimingFunction: Vivus.EASE,
			start: "manual"
		}, drawingDonePeach);

		var v_tulip = new Vivus('drawing_tulip', {
			type: 'delayed',
			duration: 200,
			animTimingFunction: Vivus.EASE,
			start: "manual"
		}, drawingDoneTulip);

		var v_goat = new Vivus('drawing_goat', {
			type: 'delayed',
			duration: 200,
			animTimingFunction: Vivus.EASE,
			start: "manual"
		}, drawingDoneGoat);

		var v_sunset = new Vivus('drawing_sunset', {
			type: 'oneByOne',
			duration: 900,
			animTimingFunction: Vivus.EASE,
			start: "manual"
		}, drawingDone);

		//

		var drawingIndex = 0;

		function drawNext() {
			if( drawingIndex > 4){
				drawingIndex = 0;
			}
			switch (drawingIndex) {
				case 0:
					//console.log("DRAWNEXT SUNSET");
					drawSunset();
					break;
				case 1:
					//console.log("DRAWNEXT TULIP");
					drawTulip();
					break;
				case 2:
					//console.log("DRAWNEXT PEACH");
					drawPeach();
					break;
				case 3:
					//console.log("DRAWNEXT PINEAPPLES");
					drawPineapples();
					break;
				case 4:
					//console.log("DRAWNEXT GOAT");
					drawGoat();
					break;
				default:
				//console.log("DRAWNEXT RESET");
					drawingIndex = 0;
					drawNext();
					break;
			}
			drawingIndex++;
		}

		function resetScreen() {
			resetIndex = drawingIndex - 1;
			if(drawingIndex == 0){
				resetIndex = 4;
			}
			console.log(resetIndex + " - RESET INDEX");
			$("svg").fadeOut("slow", function() {
			    
			});
			switch (resetIndex) {
				case 0:
					//drawSunset();
					//console.log("RESETSCREEN SUNSET");
					$.each($("#drawing_sunset").children(), function(i, v) {

						if ($(v).attr("stroke")) {
							$(v).css("fill", "transparent");
						}
					});
					v_sunset.reset();
					break;
				case 1:
					//drawTulip();
					//console.log("RESETSCREEN TULIP");
					$.each($("#drawing_tulip").children(), function(i, v) {

						if ($(v).attr("stroke")) {
							$(v).css("fill", "transparent");
						}
					});
					v_tulip.reset();
					break;
				case 2:
					//drawPeach();
					//console.log("RESETSCREEN PEACH");
					$.each($("#drawing_peach").children(), function(i, v) {

						if ($(v).attr("stroke")) {
							$(v).css("fill", "transparent");
						}
					});
					v_peach.reset();
					break;
				case 3:
					//drawPineapples();
					//console.log("RESETSCREEN PINEAPPLES");
					$.each($("#drawing_pineapples").children(), function(i, v) {

						if ($(v).attr("stroke")) {
							$(v).css("fill", "transparent");
						}
					});
					v_pineapples.reset();
					break;
				case 4:
					//drawGoat();
					//console.log("RESETSCREEN GOAT");
					$.each($("#drawing_goat").children(), function(i, v) {

						if ($(v).attr("stroke")) {
							$(v).css("fill", "transparent");
						}
					});
					v_goat.reset();
					break;
				default:
					break;
			}
			drawNext();
			
		}
	</script>
</body>

</html>
